import React, { Component } from "react";

class Project extends Component {
  state = {
    project: {
      id: "0",
      shortname: "salespath"
    }
  };
  render() {
    return (
      <React.Fragment>
        <h1>Project {this.state.project.id}</h1>
        <h3>Name: {this.state.project.shortname}</h3>
      </React.Fragment>
    );
  }
}

export default Project;
